	}

},[])
  const AvailableMeals = () =>{
	  const meals=	DUMMY_MEALS.map((meal)=>{
		return(  <MealsItem
		     id={meal.id}
		     key={meal.id}
			 name={meal.name}
			 description={meal.description}
			 price={meal.price}
		/>
	  
	)
	})
	
	  return(
		  
		  <section className={classes.meals}>
		  <Card>
		  {meals}
          </Card>
		  </section>
		 


	  )
  }
  export default AvailableMeals;
